% Generate variables
xx = create_vars(9+4+3);

% Parameterization
H = reshape(xx(1:9),3,3);
q = [1;xx(10:12)];
s = xx(13);
n = q(2:4);
t = xx(14:16);
R = quat2rot(q);

% Governing equations
eqs = s*H-(R+t*n');
eqs = [eqs(:); t'*n];

% Saturate (remove degeneracy)
opt = default_options();
opt.M2_path = '/usr/bin/M2';
opt.saturate_mon = q'*q;

% Compute generators of the elimination ideal
out = eliminate_vars(eqs, 10:16, opt);

